import React, { useState, useEffect } from 'react';
import './App.css';
import GameViewer from './components/GameViewer';
import SummaryView from './components/SummaryView';
import Controls from './components/Controls';

function App() {
  const [activeTab, setActiveTab] = useState('overview');
  const [gameData, setGameData] = useState(null);
  const [summaryData, setSummaryData] = useState(null);
  const [currentTurn, setCurrentTurn] = useState(0);
  const [isPlaying, setIsPlaying] = useState(false);
  const [playbackSpeed, setPlaybackSpeed] = useState(500);
  const [selectedGame, setSelectedGame] = useState(null);
  const [availableGames, setAvailableGames] = useState([]);

  // Load available game files
  useEffect(() => {
    loadAvailableGames();
  }, []);

  const loadAvailableGames = async () => {
    try {
      // Try to load the checkpoint file to see what games are available
      const checkpointResponse = await fetch('/game_checkpoint_latest.json');
      if (checkpointResponse.ok) {
        const checkpoint = await checkpointResponse.json();
        const timestamp = checkpoint.timestamp;
        const totalGames = checkpoint.total_games || 1;
        
        // Build list of available games
        const games = [];
        for (let i = 1; i <= totalGames; i++) {
          games.push({
            id: `game_${i}`,
            name: `Game ${i}`,
            boards: `/game_${String(i).padStart(3, '0')}_boards_${timestamp}.json`,
            reasoning: `/game_${String(i).padStart(3, '0')}_reasoning_${timestamp}.json`,
            summary: totalGames > 1 ? `/game_summary_${timestamp}.txt` : null
          });
        }
        
        setAvailableGames(games);
        if (games.length > 0) {
          loadGame(games[0]);
        }
      } else {
        // Fallback: try to load a single game file
        loadDefaultGame();
      }
    } catch (error) {
      console.error('Error loading games:', error);
      loadDefaultGame();
    }
  };

  const loadDefaultGame = async () => {
    // Try common patterns for game files
    const patterns = [
      '/game_001_boards_latest.json',
      '/game_boards_latest.json',
    ];
    
    for (const pattern of patterns) {
      try {
        const response = await fetch(pattern);
        if (response.ok) {
          const data = await response.json();
          setGameData(data);
          setAvailableGames([{
            id: 'game_1',
            name: 'Game 1',
            boards: pattern
          }]);
          return;
        }
      } catch (e) {
        // Try next pattern
      }
    }
  };

  const loadGame = async (gameFile) => {
    try {
      const response = await fetch(gameFile.boards);
      const data = await response.json();
      setGameData(data);
      setSelectedGame(gameFile);
      setCurrentTurn(0);
      setIsPlaying(false);
      
      // Try to load summary if available
      if (gameFile.summary) {
        const summaryResponse = await fetch(gameFile.summary);
        const summary = await summaryResponse.text();
        setSummaryData(summary);
      }
    } catch (error) {
      console.error('Error loading game:', error);
    }
  };

  // Auto-play functionality
  useEffect(() => {
    let interval;
    if (isPlaying && gameData) {
      const maxTurns = Math.max(
        ...Object.values(gameData).map(agent => agent.board_history.length)
      );
      
      if (currentTurn < maxTurns - 1) {
        interval = setInterval(() => {
          setCurrentTurn(prev => prev + 1);
        }, playbackSpeed);
      } else {
        setIsPlaying(false);
      }
    }
    return () => clearInterval(interval);
  }, [isPlaying, currentTurn, gameData, playbackSpeed]);

  const handlePlayPause = () => {
    if (!gameData) return;
    setIsPlaying(!isPlaying);
  };

  const handleReset = () => {
    setCurrentTurn(0);
    setIsPlaying(false);
  };

  const handleStepForward = () => {
    if (!gameData) return;
    const maxTurns = Math.max(
      ...Object.values(gameData).map(agent => agent.board_history.length)
    );
    if (currentTurn < maxTurns - 1) {
      setCurrentTurn(prev => prev + 1);
    }
  };

  const handleStepBackward = () => {
    if (currentTurn > 0) {
      setCurrentTurn(prev => prev - 1);
    }
  };

  const getMaxTurns = () => {
    if (!gameData) return 0;
    return Math.max(
      ...Object.values(gameData).map(agent => agent.board_history.length)
    );
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>ðŸš¢ Battleship AI Game Viewer</h1>
        <nav className="tab-nav">
          <button
            className={activeTab === 'overview' ? 'active' : ''}
            onClick={() => setActiveTab('overview')}
          >
            Game Overview
          </button>
          <button
            className={activeTab === 'summary' ? 'active' : ''}
            onClick={() => setActiveTab('summary')}
          >
            Summary Results
          </button>
        </nav>
      </header>

      <main className="App-main">
        {activeTab === 'overview' && (
          <>
            <Controls
              currentTurn={currentTurn}
              maxTurns={getMaxTurns()}
              isPlaying={isPlaying}
              playbackSpeed={playbackSpeed}
              onPlayPause={handlePlayPause}
              onReset={handleReset}
              onStepForward={handleStepForward}
              onStepBackward={handleStepBackward}
              onSpeedChange={setPlaybackSpeed}
              onTurnChange={setCurrentTurn}
              availableGames={availableGames}
              selectedGame={selectedGame}
              onGameSelect={loadGame}
            />
            <GameViewer
              gameData={gameData}
              currentTurn={currentTurn}
            />
          </>
        )}
        {activeTab === 'summary' && (
          <SummaryView summaryData={summaryData} />
        )}
      </main>

      <footer className="App-footer">
        <p>Battleship AI Comparison Framework</p>
      </footer>
    </div>
  );
}

export default App;
